-- ----------------------------
-- Procedure structure for SPEPA_GLPI
-- ----------------------------
DROP PROCEDURE IF EXISTS `SPEPA_GLPI`;
delimiter ;;
CREATE PROCEDURE `SPEPA_GLPI`(Vtipo varchar(25))
BEGIN

  IF Vtipo="consulta" THEN
  
       idUsuario,
         name,
         Equipo,
         Serial,
         OtroSerial,
         Modelo,
         Tipo,
         idEquipo
     )
        select 
        u.id as id,
        concat(u.realname,' ',u.firstname) as name,
        c.name as Equipo,
        c.serial as Serial,
        c.otherserial as OtroSerial,
        cm.name as Modelo,
        ct.name as Tipo,
        c.id as idEquipo
        from glpi_users as u
        inner join glpi_computers c on u.id=c.users_id
        left join glpi_computermodels cm on cm.id = c.computermodels_id
        left join glpi_computertypes ct on ct.id = c.computertypes_id
        where u.is_active=1
        and c.name is not null
        and u.user_dn is not null
        ORDER BY id asc;
        
       idUsuario,
         name,
         Equipo,
         Serial,
         OtroSerial,
         Modelo,
         Tipo,
         idEquipo
     )
        select 
        u.id as id,
        concat(u.realname,' ',u.firstname) as name,
        m.name as Equipo,
        m.serial as Serial,
        m.otherserial as OtroSerial,
        mcm.name as Modelo,
        mct.name as Tipo,
        m.id as idEquipo
      from glpi_users as u
        inner join glpi_monitors m on m.users_id=u.id
        left join glpi_monitormodels mcm on mcm.id = m.monitormodels_id
        left join glpi_monitortypes mct on mct.id = m.monitortypes_id
        where u.is_active=1
        and m.name is not null
        and u.user_dn is not null
        ORDER BY id asc;


       idUsuario,
         name,
         Equipo,
         Serial,
         OtroSerial,
         Modelo,
         Tipo,
         idEquipo
     )
        select 
        u.id as id,
        concat(u.realname,' ',u.firstname) as name,
        p.name as Equipo,
        p.serial as Serial,
        p.otherserial as OtroSerial,
        mpm.name as Modelo,
        mpt.name as Tipo,
        p.id as idEquipo
  from glpi_users as u
        inner join glpi_peripherals p on p.users_id=u.id
        left join glpi_peripheralmodels mpm on mpm.id = p.peripheralmodels_id
        left join glpi_peripheraltypes mpt on mpt.id = p.peripheraltypes_id
        where u.is_active=1
        and p.name is not null
        and u.user_dn is not null
        ORDER BY id asc;


       idUsuario,
         name,
         Equipo,
         Serial,
         OtroSerial,
         Modelo,
         Tipo,
         idEquipo
     )
        select 
        u.id as id,
        concat(u.realname,' ',u.firstname) as name,
        pr.name as Equipo,
        pr.serial as Serial,
        pr.otherserial as OtroSerial,
        mprm.name as Modelo,
        mprt.name as Tipo,
        pr.id as idEquipo
  from glpi_users as u
        inner join glpi_printers pr on pr.users_id=u.id
        left join glpi_printermodels mprm on mprm.id = pr.printermodels_id
        left join glpi_printertypes mprt on mprt.id = pr.printertypes_id
        where u.is_active=1
        and pr.name is not null
        and u.user_dn is not null
        ORDER BY id asc;


   select id,idUsuario,name,Equipo,Serial,OtroSerial,Modelo,Tipo as TipoEquipo,idEquipo from glpi_epacore;
        
    END IF;
 IF Vtipo="elimina" THEN
 delete from glpi_epacore;
 END IF;
END
;;
delimiter ;

-- ----------------------------
-- Procedure structure for SPEPA_INFORMES
-- ----------------------------
DROP PROCEDURE IF EXISTS `SPEPA_INFORMES`;
delimiter ;;
CREATE PROCEDURE `SPEPA_INFORMES`(tipo varchar(25),
										Vid int(11),
										Vasunto varchar(500),
										Vantecedentes text,
										Vobjetivos text,
										Vconclusiones text,
										Vrecomendaciones text,
										VusuarioInforme varchar(50),
										VUsuarioEncargado varchar(200),
										Vchecklist varchar(50),	
										VtablaEquipos text,
										Vproblemas varchar(255),
										VtablaProblemas text,
										Vusuarioelaborado varchar(255),
										Vusuariorevisado varchar(255),
										Vusuariorecibido varchar(255),
										Vusuarioaprobado varchar(255),
										Vusuarioelaboradocargo varchar(255),
										Vusuariorevisadocargo varchar(255),
										Vusuariorecibidocargo varchar(255),
										Vusuarioaprobadocargo varchar(255),
										VtablaPiePaginas text,		
										Vcategoriasproblemas text,
										Vacciones text,
										Vanexos longtext,
										Varregloanexos varchar(255),
										VanexosCarga longtext,
										VFechaInicio varchar(50),
										VFechaFin varchar(50))
BEGIN

		
		IF tipo="consultafecha" THEN
		
		select inf.id as nid,
					 inf.asunto,
					 inf.antecedentes,
					 inf.objetivos,
					 inf.conclusiones,
					 inf.recomendaciones,
					 inf.checklist,
					 inf.usuarioInforme,
					 inf.UsuarioEncargado,
					 inf.tablaEquipos,
					 inf.created_at,
					 inf.problemas,
					 inf.acciones,
					 inf.tablaProblemas,
						inf.usuarioelaborado,
						inf.usuariorevisado,
						inf.usuariorecibido,
						inf.usuarioaprobado,		
						inf.usuarioelaboradocargo,
						inf.usuariorevisadocargo,
						inf.usuariorecibidocargo,
						inf.usuarioaprobadocargo,	
						inf.tablaPiePaginas,
						inf.categoriasProblemas,
					  inf.anexos,
						inf.arregloanexos,
						inf.anexosCarga,
						inf.revisado,
						inf.aprobado
		from informestecnicos as inf
		WHERE inf.estado='ACT'
		AND CAST(inf.created_at as DATE) BETWEEN CAST(VFechaInicio as date) AND CAST(VFechaFin AS DATE);
		
		
		
		END IF;
		
		IF tipo="crea" THEN
				asunto,
				antecedentes,
				objetivos,
				acciones,
				conclusiones,
				recomendaciones,
				checklist,
				usuarioInforme,
				UsuarioEncargado,
				tablaEquipos,
				problemas,
				tablaProblemas,
				created_at,
				usuarioelaborado,
				usuariorevisado,
				usuariorecibido,
				usuarioaprobado,		
				usuarioelaboradocargo,
				usuariorevisadocargo,
				usuariorecibidocargo,
				usuarioaprobadocargo,	
				tablaPiePaginas,
				categoriasProblemas,
			  anexos,
			  arregloanexos,
			  anexosCarga	
			)
			value 
			(
				Vasunto,
				Vantecedentes,
				Vobjetivos,
				Vacciones,
				Vconclusiones,
				Vrecomendaciones,
				Vchecklist,
				VusuarioInforme,
				VUsuarioEncargado,
				VtablaEquipos,
				Vproblemas,
				VtablaProblemas,
				CURDATE(),
				Vusuarioelaborado,
				Vusuariorevisado,
				Vusuariorecibido,
				Vusuarioaprobado,		
				Vusuarioelaboradocargo,
				Vusuariorevisadocargo,
				Vusuariorecibidocargo,
				Vusuarioaprobadocargo,	
				VtablaPiePaginas,
				Vcategoriasproblemas,
				Vanexos,
				Varregloanexos,
				VanexosCarga
			);
					
			SELECT "GRABADO EXITOSAMENTE" as message,"200" as status;
		
		END IF;
		IF tipo="actualiza" THEN
			update informestecnicos
			set asunto=Vasunto,
				antecedentes=Vantecedentes,
				objetivos=Vobjetivos,
				acciones=Vacciones,
				conclusiones=Vconclusiones,
				recomendaciones=Vrecomendaciones,
				checklist=Vchecklist,
				usuarioInforme=VusuarioInforme,
				UsuarioEncargado=VUsuarioEncargado,
				tablaEquipos=VtablaEquipos,
				problemas=Vproblemas,
				tablaProblemas=VtablaProblemas,
				updated_at=CURDATE(),
				usuarioelaborado=Vusuarioelaborado,
				usuariorevisado=Vusuariorevisado,
				usuariorecibido=Vusuariorecibido,
				usuarioaprobado=Vusuarioaprobado,	
				usuarioelaboradocargo=Vusuarioelaboradocargo,
				usuariorevisadocargo=Vusuariorevisadocargo,
				usuariorecibidocargo=Vusuariorecibidocargo,
				usuarioaprobadocargo=Vusuarioaprobadocargo,
				tablaPiePaginas=VtablaPiePaginas,
				categoriasProblemas=Vcategoriasproblemas,
				anexos=Vanexos,
				arregloanexos=Varregloanexos,
				anexosCarga=VanexosCarga
			where id=Vid;
			SELECT "ACTUALIZADO EXITOSAMENTE" as message,"200" as status;
		
		END IF;
			IF tipo="elimina" THEN
		 update informestecnicos
			set estado='INA'
			where id=Vid;
			SELECT "ELIMINADO EXITOSAMENTE" as message,"200" as status;
		
		END IF;
	END
;;
delimiter ;

