INSERT INTO `informestecnicos` VALUES (18, 'ASUNTO DE EJEMPLO', '<p>ANTECEDENTE DE EJEMCPLO</p><p>RECOMENDACION DE EJEMPLO</p><p>RECOMENDACION 2 DE EJEMPLO</p><p>RECOMENDACION&nbsp;&nbsp;3 DE EJEMPLO</p><p>RECOMENDACION DE EJEMPLO</p><p>RECOMENDACION 2 DE EJEMPLO</p><p>RECOMENDACION&nbsp;&nbsp;3 DE EJEMPLO</p><p>RECOMENDACION DE EJEMPLO</p><p>RECOMENDACION 2 DE EJEMPLO</p><p>RECOMENDACION&nbsp;&nbsp;3 DE EJEMPLO</p><p>RECOMENDACION DE EJEMPLO</p><p>RECOMENDACION 2 DE EJEMPLO</p><p>RECOMENDACION&nbsp;&nbsp;3 DE EJEMPLO</p>', '<ol><li>dfgdfgd</li><li>dfgdfgdf</li></ol>', '<p>El Ing. Pablo Rivera, Director de Planificaci&oacute;n, informa el 20 de junio de 2019 mediante correo electr&oacute;nico, al Director Administrativo lo siguiente:</p><p>&nbsp;</p><p><em>&ldquo;Mi computadora port&aacute;til presenta un desperfecto con la bater&iacute;a, debido a que la computadora &uacute;nicamente funciona con el cargador conectado. En este sentido me permito solicitar se realice el an&aacute;lisis respectivo, el arreglo respectivo y se provea de una nueva computadora port&aacute;til mientras se soluciona el problema&rdquo;.</em></p><p>Mediante correo electr&oacute;nico del 23 de julio de 2018, el Ing. Christhian Le&oacute;n, de la Direcci&oacute;n Administrativa, solicita <em>&quot;se realice el informe t&eacute;cnico del siguiente equipo inform&aacute;tico, del servidor Ing. Pablo Rivera, a fin de conocer su estado actual&quot;.</em></p><p>&nbsp;</p>', '<p>CONCLUSION DE EJEMPLO</p><p>CONCLUSION 2 DE EJEMPLO</p><p>CONCLUSION 3 DE EJEMPLO</p><p>CONCLUSION DE EJEMPLO</p><p>CONCLUSION 2 DE EJEMPLO</p><p>CONCLUSION 3 DE EJEMPLO</p><p>&nbsp;asdasd</p><p>asd</p><p>asdddddddddddddd</p>', '<p>RECOMENDACION DE EJEMPLO</p><p>RECOMENDACION 2 DE EJEMPLO</p><p>RECOMENDACION&nbsp;&nbsp;3 DE EJEMPLO</p><p>RECOMENDACION DE EJEMPLO</p><p>RECOMENDACION 2 DE EJEMPLO</p><p>RECOMENDACION&nbsp;&nbsp;3 DE EJEMPLO</p><p>&nbsp;asdasd</p><p>asd</p><p>asdddddddddddddd</p>', '56,24', 14, 'Espinoza Fajardo Anthony', '<table style=\"width:100%\" border=1><tr><td><span style=\"font-weight:bold;\">Custodio</span></td><td><span style=\"font-weight:bold;\">Equipo</span></td><td><span style=\"font-weight:bold;\">Serial</span></td><td><span style=\"font-weight:bold;\">C&oacute;digo EPA</span></td><td><span style=\"font-weight:bold;\">Modelo</span></td><td><span style=\"font-weight:bold;\">Tipo</span></td></tr><tr><td>Espinoza Fajardo Anthony</td><td>SAM-DTIC-11</td><td>MXL4281NGN</td><td>007-01-02-001577</td><td>PRODESK 600 G1 TWR</td><td>Desktop</td></tr></table>', '<p style=\"line-height:3\">El equipo recibido tiene las siguientes caracter&iacute;sticas</p><table style=\"width:100%\" border=1><tr><td width=\"80%\"><span style=\"font-weight:bold;text-align:center\">DESCRIPCI&Oacute;N</span></td><td width=\"20%\"><span style=\"font-weight:bold;text-align:center\">CHECKLIST</span></td></tr><tr><td width=\"80%\">ERROR DE DISCO DURO</td><td width=\"20%\">&#x2714;</td></tr><tr><td width=\"80%\">CABLE ROTO</td><td width=\"20%\">&#x2714;</td></tr><tr><td width=\"80%\">UNIDAD DVD NO LEE</td><td width=\"20%\">&#x2714;</td></tr></table>', '60,63,62', 'ACT', '2019-07-17', '2019-09-06', NULL, NULL, 'anthony.espinoza', 'isabela.aguilar', 'anthony.espinoza', 'anthony.espinoza', 'Director de la AREA=Dirección de Tecnología de la Información', 'Profesional 5 de la AREA=Dirección de Tecnología de la Información', 'Directora de la AREA=Dirección de Talento Humano', 'Profesional 2 de la AREA=Dirección de Tecnología de la Información', '<table style=\"width:100%\" border=1><tr><td width=\"25%\"><span style=\"font-weight:bold;\">Acci&oacute;n</span></td><td  width=\"25%\"><span style=\"font-weight:bold;\">Nombre</span></td><td  width=\"30%\"><span style=\"font-weight:bold;\">Cargo</span></td><td  width=\"20%\"><span style=\"font-weight:bold;\">Firma</span></td></tr><tr><td><span style=\"font-weight:bold;\">Elaborado por:</span></td><td>Espinoza Fajardo Anthony</td><td>Profesional 2 de la Direc